import React from 'react';
import {SignIn, SignUp} from '../../components/form/Form';
import './sign-in.scss'

const SignInPage = () => {
    return ( 
        <div className="sign-in-and">
            <SignIn/>
            <SignUp/>
        </div>
     );
}

export default SignInPage;
